tables.table_schema:
CREATE TABLE parks (
  park_id INT PRIMARY KEY,
  park_name VARCHAR(255) NOT NULL,
  park_district VARCHAR(50) NOT NULL,
  park_size FLOAT
);

CREATE TABLE parks (
  park_id INT PRIMARY KEY,
  park_name VARCHAR(100) NOT NULL,
  park_area FLOAT NOT NULL,
  park_location VARCHAR(255) NOT NULL
);

CREATE TABLE green_spaces (
  space_id INT PRIMARY KEY,
  space_name VARCHAR(100) NOT NULL,
  space_area FLOAT NOT NULL,
  has_trees BOOLEAN
);

CREATE TABLE parks (
  park_id INT PRIMARY KEY,
  park_name VARCHAR(255) NOT NULL,
  location VARCHAR(255) NOT NULL,
  area_acres FLOAT
);

CREATE TABLE park_features (
  feature_id INT PRIMARY KEY,
  feature_name VARCHAR(255) NOT NULL,
  description TEXT
);

CREATE TABLE park_visitors (
  visitor_id INT PRIMARY KEY,
  park_id INT NOT NULL,
  visitor_name VARCHAR(255) NOT NULL,
  visit_date DATE
);
